import React from 'react';
import './Dashboard.css'; // Import common dashboard CSS

const AdminDashboard = () => {
  // Sample data for users, events, and advertisements
  const sellers = [
    { id: 1, name: "Seller 1" },
    { id: 2, name: "Seller 2" },
  ];

  const artisans = [
    { id: 1, name: "Artisan 1" },
    { id: 2, name: "Artisan 2" },
  ];

  const hosts = [
    { id: 1, name: "Host 1" },
    { id: 2, name: "Host 2" },
  ];

  const events = [
    { id: 1, title: "Event 1" },
    { id: 2, title: "Event 2" },
  ];

  const ads = [
    { id: 1, title: "Ad 1" },
    { id: 2, title: "Ad 2" },
  ];

  const handleApproveSeller = (id) => {
    alert(`Seller ${id} approved!`);
  };

  const handleRejectSeller = (id) => {
    alert(`Seller ${id} rejected!`);
  };

  const handleDeleteSeller = (id) => {
    alert(`Seller ${id} deleted!`);
  };

  const handleDeleteArtisan = (id) => {
    alert(`Artisan ${id} deleted!`);
  };

  const handleDeleteHost = (id) => {
    alert(`Host ${id} deleted!`);
  };

  const handleApproveEvent = (id) => {
    alert(`Event ${id} approved!`);
  };

  const handleRejectEvent = (id) => {
    alert(`Event ${id} rejected!`);
  };

  const handleApproveAd = (id) => {
    alert(`Ad ${id} approved!`);
  };

  const handleRejectAd = (id) => {
    alert(`Ad ${id} rejected!`);
  };

  return (
    <div className="dashboard-container">
      <h1>Admin Dashboard</h1>
      <div className="stats">
        <div className="stat-card">Total Sellers: {sellers.length}</div>
        <div className="stat-card">Total Artisans: {artisans.length}</div>
        <div className="stat-card">Total Hosts: {hosts.length}</div>
        <div className="stat-card">Total Events: {events.length}</div>
        <div className="stat-card">Total Advertisements: {ads.length}</div>
      </div>

      <h2>Seller Management</h2>
      <ul className="user-list">
        {sellers.map((seller) => (
          <li key={seller.id}>
            {seller.name}
            <button onClick={() => handleApproveSeller(seller.id)}>Approve</button>
            <button onClick={() => handleRejectSeller(seller.id)}>Reject</button>
            <button onClick={() => handleDeleteSeller(seller.id)}>Delete</button>
          </li>
        ))}
      </ul>

      <h2>Artisan Management</h2>
      <ul className="user-list">
        {artisans.map((artisan) => (
          <li key={artisan.id}>
            {artisan.name}
            <button onClick={() => handleDeleteArtisan(artisan.id)}>Delete</button>
          </li>
        ))}
      </ul>

      <h2>Host Management</h2>
      <ul className="user-list">
        {hosts.map((host) => (
          <li key={host.id}>
            {host.name}
            <button onClick={() => handleDeleteHost(host.id)}>Delete</button>
          </li>
        ))}
      </ul>

      <h2>Event Management</h2>
      <ul className="event-list">
        {events.map((event) => (
          <li key={event.id}>
            {event.title}
            <button onClick={() => handleApproveEvent(event.id)}>Approve</button>
            <button onClick={() => handleRejectEvent(event.id)}>Reject</button>
          </li>
        ))}
      </ul>

      <h2>Advertisement Management</h2>
      <ul className="ad-list">
        {ads.map((ad) => (
          <li key={ad.id}>
            {ad.title}
            <button onClick={() => handleApproveAd(ad.id)}>Approve</button>
            <button onClick={() => handleRejectAd(ad.id)}>Reject</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AdminDashboard;
